import { format } from "date-fns";

export const COLUMNS = [
  {
    Header: "First Name",
    accessor: "first_name",
  },
  {
    Header: "Last Name",
    accessor: "last_name",
  },
  {
    Header: "Provider",
    accessor: "provider",
  },
  {
    Header: "DOB",
    accessor: "dob",
  },
  {
    Header: "Gap",
    accessor: "CBP",
  },
  {
    Header: "Sys",
    accessor: "systolic",
  },
  {
    Header: "Dia",
    accessor: "diastolic",
  },
  {
    Header: "Date Taken",
    accessor: "date",
  },
  {
    Header: "Last Visit",
    accessor: "last_visit",
  },
  {
    Header: "Next Visit",
    accessor: "next_visit",
  },
  {
    Header: "Status",
    accessor: "status",
  },
  {
    Header: "Description",
    accessor: "null",
  },
];
